INSERT INTO `skyblock_dungeon_bosses` (`id`, `key`, `name`, `description`, `updated_at`) VALUES
	(2, 'BONZO', 'Bonzo', 'Involved in his dark arts due to his parents\' insistence. Originally worked as a Circus clown.', '2021-11-03 23:29:13'),
	(6, 'LIVID', 'Livid', 'Strongly believes he will become the Lord one day. Subject of the mockeries, even from his disciples.', '2021-11-03 23:29:13'),
	(8, 'NECRON', 'Necron', 'Right hand of the Wither King. Inherited the Catacombs eons ago. never defeated, feared by anything living AND dead.', '2021-11-03 23:29:13'),
	(7, 'SADAN', 'Sadan', 'Necromancy was always strong in his family. Says he once beat a Wither in a duel. Likes to brag.', '2021-11-03 23:29:13'),
	(3, 'SCARF', 'Scarf', 'First of his class. His teacher said he will do "great things".', '2021-11-03 23:29:13'),
	(4, 'THE_PROFESSOR', 'The Professor', 'Despite his great technique, he failed the Masters exam three times. Works from 8 to 5. Cares about his students.', '2021-11-03 23:29:13'),
	(5, 'THORN', 'Thorn', 'Powerful Necromancer that specializes in animals. Calls himself a vegetarian, go figure.', '2021-11-03 23:29:13'),
	(1, 'WATCHER', 'Watcher', 'This strange creature is roaming the Catacombs to add powerful adventurers to its collection.', '2021-11-03 23:29:13');
