INSERT INTO `skyblock_dungeon_fairy_souls` (`id`, `room`, `description`, `where`, `walkable`, `updated_at`) VALUES
	(1, '1*3', 'Zigzag-shaped passages, many boxes made of wooden stair blocks, and a knight statue made of diorite, there will be 2 Torches on a wall and move to the nearest room on the left.', 'In a pond of 2*2 water blocks behind the Dark Oak box.', b'1', '2021-10-25 22:59:19'),
	(2, 'Tomioka', 'Go to the second Jail Cell on the left, and walk through the secret Entrance to Tomioka.', 'Underneath the Staircase.', b'1', '2021-10-25 22:59:19'),
	(3, '1*1', 'A chest on top of a broken cubic prison, teleport to the Vines near where some skulls lay.', 'Behind some Leaves.', b'0', '2021-10-25 22:59:19'),
	(4, '1*2', '2 staircases and 5 stone coffins in the center, go to some sticks and go to the top.', 'On the Mossy Stone Bricks. ', b'0', '2021-10-25 22:59:19'),
	(5, '2*2', 'A big staircase on the sides, go to a little pocket next to where the stairs lead.', 'Near some Mossy Stone Bricks.', b'1', '2021-10-25 22:59:19'),
	(6, '1*1', 'In a prison-like room, there will be 2 cells next to each other and on top will be an empty area.', 'Top-left corner on top of the cells.', b'0', '2021-10-25 22:59:19'),
	(7, '1*4', 'A chest hanging from the ceiling, beneath that is a hole with some Vines made out of Leaves.', 'Behind the Vines.', b'1', '2021-10-25 22:59:19'),
	(8, '2*2', 'A huge wooden gate (if the lever isn\'t pulled), a lever on a polished granite block on the top of a broken pillar, and a bunch of Withermancers, go to a large space with few stone bricks.', 'Behind some Leaves on the wall on the opposite side of the staircase.', b'0', '2021-10-25 22:59:19'),
	(9, '1*1', 'In the Admin coffin room.', 'Behind Simon Hypixel\'s coffin.', b'0', '2021-10-25 22:59:19');
